import React, { Component } from 'react';
import NavigationBarLink from './NavigationBarLink'
import './css/main.css'

// import fire from './fire';

class NavigationBar extends Component {
    constructor(props) {
        super(props);
        this.state = {
            sublinks : [
                ["Home", "https://luislondono.com/", null],
                ["Resume", "https://docs.google.com/document/d/1av1XlOl_ZTY2W7YGD1Kn3YUUMBhXLhLa5DjAMa0V2_I/edit?usp=sharing", null],
            ]
        };
    }

    render() {


        return (
            <div className = 'navbar-container'>
                <div className="navbar-logo">
                    <a href="https://luislondono.com/">Luis Hernando Londono</a>
                </div>



                <nav>
				    <ul>
                        <NavigationBarLink InnerText = "Home" link ="https://luislondono.com/"  ></NavigationBarLink>
                        <li class="nav-link"><a href="https://luislondono.com/">Home</a></li>
                        <li class="nav-link"><a href="https://docs.google.com/document/d/1av1XlOl_ZTY2W7YGD1Kn3YUUMBhXLhLa5DjAMa0V2_I/edit?usp=sharing">Resume</a></li>
                        <li class="nav-link"><a href="myWork">My Work</a></li>
                        <li class="nav-link" id="dropdown-content">Gallery</li>
                        <li class="social-media-link"><a href="https://www.github.com/LuisLondono"> <img src="images/githubLogo.svg" alt=""></img></a></li>
                        <li class="social-media-link"><a href="https://www.facebook.com/luislondonoramos"><img
                                src="images/facebookLogo.svg" alt=""></img></a></li>
                        <li class="social-media-link"><a href="https://www.linkedin.com/in/luislondonoramos"><img
                                src="images/linkedinLogo.svg" alt=""></img></a></li>
				    </ul>

			    </nav>
            </div>
        );
    }


}
export default NavigationBar;
